import React, { useEffect } from "react";
import { Container, Row, Col, Navbar, Table, Card } from "react-bootstrap";
import axios from "axios";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  useEffect(() => {
    axios
      .get("http://localhost:8010/proxy", {
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
        },
      })
      .then((res) => {
        const data = res.data;
        console.log(data);
      })
      .catch((error) => {
        console.log(error);
      });
  });

  return (
    <Container className="container">
      <Row>
        <Navbar bg="light">
          <Navbar.Brand>Eureka dashboard</Navbar.Brand>
        </Navbar>
      </Row>
      <Row>
        <Col>
          <Card></Card>
        </Col>
        <Col>
          <Card>
            <h3>Online</h3>
          </Card>
        </Col>
        <Col>
          <Card>
            <h3>Offline</h3>
          </Card>
        </Col>
      </Row>
      <Row>
        <Table>
          <thead>
            <tr>
              <th>Application Name</th>
              <th>Host</th>
              <th>Instance</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>STUDENTSERVICE</td>
              <td>192.168.10.253</td>
              <td>studentservice:8081</td>
              <td>UP</td>
            </tr>
          </tbody>
        </Table>
      </Row>
    </Container>
  );
}

export default App;
